(38065, NULL, NULL, '杉山裕子', 28250803, 2, NULL, NULL, NULL, 99, '杉山 裕子（すぎやま ゆうこ、1975年1月11日 - ）は、元中京テレビ放送 中京テレビ契約アナウンサー。愛知県出身。愛知淑徳大学短期大学卒業。NNNドキュメントや中京テレビニュースプラス1などでナレーションを主に担当。2005年3月をもって中京テレビを退社したことを機に東京に活動の場を移した。そのため、所属していた名古屋タレントビューローから、東京のシグマ・セブンに移籍し、ナレーション・声優に特化した活動をしている。 日本テレビ放送網 日本テレビ『スッキリ!!』内コーナー「今日の占い スッキリ!!ボッ', NULL, '杉山裕子	', NULL, '2012-08-27 05:02:13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 6745, '', 0, 0, 'http://www.weblio.jp/img/dict/tlttm/images/2000053296.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(38066, NULL, NULL, 'やらないか', NULL, 2, NULL, NULL, NULL, 227, '『山川純一』より : 山川 純一(やまかわ じゅんいち)は、ゲイ雑誌『薔薇族』で活動した漫画家。まるで1970年代の少女漫画そのままの男性キャラクターに、過剰なセックスアピールや、ギャグとも取れる強引な展開を基本スタイルとし、尚且つ時代劇やミステリー、第二次世界大戦などの様々な題材を手広く同性愛と融合させアレンジしている。10年以上にわたって日の目を見ることのなかったヤマジュン作品が再び脚光を浴びる事になったのは、あやしいわーるど＠暫定というチャット風掲示板において2002年2?7月ごろに匿名投稿者が山川', NULL, NULL, NULL, '2011-01-10 00:42:17', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 5071, '', 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
