(38068, NULL, NULL, '痴女', 30122636, 2, NULL, NULL, NULL, 250, '痴女（ちじょ）とは、猥褻行為を（しばしば常軌を逸して）好む女性を指す俗語の一種とされ、元々は風俗業界の造語とも言われており、多くの辞書には載っていない。痴漢の「漢」（男性）の対義語「女」を用いた操作的概念であり、これに相当する対象が実際に存在するかは定かではない。このように評される女性は、満員電車の混雑した所や暗い夜道など人気のない所で、相手の意に反して近づき体に触ったり、自分の性器を触らせる・性的な猥褻行為をするものとされる。いわゆる痴漢の範疇であるため、強制わいせつ罪や各地方公共団体の迷惑防止条例によ', NULL, NULL, NULL, '2012-12-22 15:30:10', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 5073, '', 0, 0, 'http://image.blog.livedoor.jp/kamimurarui/imgs/3/1/31ff12af.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
